// src/router/index.js

import { createRouter, createWebHistory } from 'vue-router';
import Home from '../views/Home.vue';  // Ensure the paths are correct
import About from '../views/About.vue'; // Ensure the paths are correct

const routes = [
  {
    path: '/',
    name: 'Home',
    component: Home, // Reference the correct component
  },
  {
    path: '/about',
    name: 'About',
    component: About, // Reference the correct component
  },
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes,
});

export default router;
